      if(total ==4){
       if(gpa <=4 && gpa >=3.5){
           grade="Excellent";
          }else if(gpa <3.5 && gpa >=3){
         grade="Very Good";
         }else if(gpa <3 && gpa >=2){
          grade="Good";        
          }else if(gpa <2 && gpa >=1){
          grade="Acceptable";         
          }else{
            grade="Poor";
          }
         }
     
     if(total ==5){
       if(gpa <=5 && gpa >=4.5){
           grade="Excellent";
          }else if(gpa <4.5 && gpa >=4){
         grade="Very Good";
         }else if(gpa <4 && gpa >=3){
          grade="Good";        
          }else if(gpa <3 && gpa >=2){
          grade="Acceptable";         
          }else{
            grade="Poor";
          }
         }
     
